import React from "react";
import "./Footer.css";
import Wave from "../../img/wave.png";
import Insta from "@iconscout/react-unicons/icons/uil-instagram";
import Facebook from "@iconscout/react-unicons/icons/uil-facebook";
import Github from "@iconscout/react-unicons/icons/uil-github";


const Footer = () => {
  return (
    <div className="footer">
      <img src={Wave} alt="" style={{ width: "100%" }} />
      <div className="f-content">
        <div className="f-icons">
          <li><a class="footer-link" href="#home">Home</a></li>
          <li><a class="footer-link" href="#about">About</a></li>
          <li><a class="footer-link" href="#services">Services</a></li>
          <li><a class="footer-link" href="#skills">Skills</a></li>
          <li><a class="footer-link" href="#teams">Teams</a></li>
          <li><a class="footer-link" href="#contact">Contact</a></li>
         <a href="https://instagram.com/suraj_r00?igshid=MzNlNGNkZWQ4Mg=="> <Insta color="white" size={"2rem"} /></a>
          <a href="https://www.facebook.com/profile.php?id=100009176339719"><Facebook color="white" size={"2rem"} /></a>
          <a href="https://github.com/surajrac800"><Github color="white" size={"2rem"} /></a>

        </div> 
        <span>surajchaurasiya8009448@gmail.com</span> 
        <br />
         <span> <p>Er. Suraj Kuamr Chaurasiya &copy;2023 All rights  reserved! </p></span>
      </div>
    </div>
  );
};

export default Footer;
